import React from 'react';
import LoginProvider from './contexts/LoginProvider'
import HostelProvider from './contexts/LoginProvider'
import Routes from "./components/Routes"
import { BrowserRouter } from 'react-router-dom';
import './App.css'

function App() {
  return (
    <LoginProvider>
        <HostelProvider>
        <BrowserRouter>
          <Routes />
    </BrowserRouter>
        </HostelProvider>
      </LoginProvider>
  );
}

export default App;
